Diagnosis.
Specimens may be distinguished by: male spur narrow in dorsal view and sharply rounded (Fig. 
37
), procursus distal area lanceolate with rounded end (Fig. 
41
) epigynum low, close ridges on the MEP and PEP (Fig. 
43
), and a rounded AEP, which may or may not appear bisected (Figs. 43, 44).
